@Override
@SuppressWarnings("unchecked")
public Collection pickSubset(Collection values) {
  Set<Object> uniqs = new HashSet<Object>();
  List<Object> result = new ArrayList<Object>(values.size());
  for (Object o : values) {
    if (!uniqs.contains(o)) {
      uniqs.add(o);
      result.add(o);
    }
  }
  return result;
}

